import React from "react";
import ReactDOM from "react-dom";
import "./index.css";

const name = "Sandeep";
const image1 = "https://upload.wikimedia.org/wikipedia/commons/b/b6/Image_created_with_a_mobile_phone.png";
const image2 = "https://media.istockphoto.com/id/1322277517/photo/wild-grass-in-the-mountains-at-sunset.jpg?s=612x612&w=0&k=20&c=6mItwwFFGqKNKEAzv0mv6TaxhLN3zSE43bWmFN--J5w=";
const links = "https://www.google.com";
ReactDOM.render(
  <>
    <h1 className="heading"> My name is {name} </h1>
    <div className = "img-div">
    <img src = "https://cdn.pixabay.com/photo/2015/04/23/22/00/tree-736885_1280.jpg"/>
    <a href = {links} target="_google">
    <img src={image2} alt="randomImage"/>
    </a>
    </div>
  </>,
  document.getElementById("root")
);
